import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Login from './pages/Login';
import Register from './pages/Register';
import Right from './pages/Right';

function App() {
  return (
<Router>
  <div style="font-size: 2.25rem /* 36px */;
    line-height: 2.5rem /* 40px */;" className="text-4xl">
    <p>Labas</p>
  </div>
      <header className="flex items-center justify-between">
        <nav className="flex items-center gap-8 text-primary font-semibold">
          <Link className="font-semibold text-2xl text-primary" to="/">
            BREWTIFUL
          </Link>
          <Link to="/">Home</Link>
          <Link to="/menu">Menu</Link>
          <Link to="/about">About</Link>
        </nav>
        <nav className="flex items-center gap-4 text-primary font-semibold">
          <Link to="/login">Login</Link>
          <Link to="/register" className="bg-primary rounded text-white px-8 py-2">
            Register
          </Link>
          <Link to="/profile">Profile</Link>
        </nav>
      </header>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/profile" element={<Right />} />
      </Routes>
    </Router>
  );
}

export default App;
